          model1 = '-,',
          model2 = '-',
          truckModelName = '';
        for (let k = 0, len1 = TRUCK_MODEL_DATA.length; k < len1; k++) {
          if (reslist[i].truckModelCode === TRUCK_MODEL_DATA[k].id) {
